package com.example.tinder.controller;

import com.example.tinder.model.dto.PeopleDto;
import com.example.tinder.model.dto.UserDto;
import org.springframework.stereotype.Controller;
import org.springframework.ui.Model;
import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.ModelAttribute;
import org.springframework.web.bind.annotation.RestController;

@Controller
public class PeopleController {
    @GetMapping("/like")
    public String peopleList( Model model) {
        PeopleDto peopleDto = new PeopleDto("John Doe", "data:image/jpeg;base64,");
        model.addAttribute("username", peopleDto.getUsername());
        model.addAttribute("photoUrl", peopleDto.getPhotoUrl());
        return "like-page";
    }
}
